PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?venue ?venueLabel WHERE {
  VALUES ?author {
    <https://dblp.org/pid/19/2932-1> <https://dblp.org/pid/236/3060> <https://dblp.org/pid/40/4160> <https://dblp.org/pid/40/4731> <https://dblp.org/pid/55/2484-1>
  }
  ?pub dblp:authoredBy ?author .
  FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> ) {
    ?pub dblp:publishedInStream ?venue .
    OPTIONAL {
      ?venue rdfs:label ?venueLabel
    }
  } UNION {
    ?pub dblp:publishedIn ?venue .
    FILTER ( isIRI( ?venue ) ) OPTIONAL {
      ?venue rdfs:label ?venueLabel
    }
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
SELECT ?paper ?title ?title2 ?title3 ?title4 WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/63/10539> .
  OPTIONAL {
    ?paper dc:title ?title
  }
  OPTIONAL {
    ?paper rdfs:label ?title2
  }
  OPTIONAL {
    ?paper schema:name ?title3
  }
  OPTIONAL {
    ?paper dblp:title ?title4
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
SELECT ?pub ?title ?venue ?venueLabel WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/64/490> .
  OPTIONAL {
    ?pub dblp:publishedInStream ?venue .
    FILTER ( ?venue IN ( <https://dblp.org/streams/conf/vtc> , <https://dblp.org/streams/journals/corr> ) ) OPTIONAL {
      ?venue rdfs:label ?venueLabel
    }
    OPTIONAL {
      ?venue dc:title ?venueLabel
    }
    OPTIONAL {
      ?venue schema:name ?venueLabel
    }
    OPTIONAL {
      ?venue dblp:streamTitle ?venueLabel
    }
  }
  OPTIONAL {
    ?pub dblp:publishedIn ?venueString .
    FILTER ( ?venueString = "VTC Spring" || ?venueString = "CoRR" ) BIND( ?venueString AS ?venueLabel )
  }
  OPTIONAL {
    ?pub rdfs:label ?title
  }
  OPTIONAL {
    ?pub dc:title ?title
  }
  OPTIONAL {
    ?pub schema:name ?title
  }
  OPTIONAL {
    ?pub dblp:title ?title
  }
  FILTER ( bound( ?venue ) || bound( ?venueLabel ) )
}

